<?php

class Shop_NewsController extends Zend_Controller_Action
{
    
    /**
     * @var Model_Service_Interface
     */
    protected $_newsService = NULL;
    
    /**
     * @var Model_Service_Interface
     */
    protected $_topicService = NULL;
    
    
    protected function _getNewsService()
    {
        if ($this->_newsService === NULL) {
            $this->_newsService = Model_Service::factory('news');
            $site = Model_Service::factory('site')->getCurrent();
            $this->_newsService->getHelper('Multisite')->setCurrentSiteId($site->id);
        }
        return $this->_newsService;
    }
    
    protected function _getTopicService()
    {
        if ($this->_topicService === NULL) {
            $this->_topicService = Model_Service::factory('news-topic');
            $site = Model_Service::factory('site')->getCurrent();
            $this->_topicService->getHelper('Multisite')->setCurrentSiteId($site->id);
        }
        return $this->_topicService;
    }
        
    
    public function init()
    {
        App_Event::factory('Shop_Controller__init', array($this))->dispatch();        
        if ($this->getRequest()->isXmlHttpRequest()) {
            $this->view->layout()->disableLayout();
            $this->getHelper('ViewRenderer')->setNoRender();
        }
        else {
            $this->view->menu()->addMenuBreadcrumbsPage(array(
                'label' => $this->view->translate('РќРѕРІРѕСЃС‚Рё'),
                'route' => 'shop-news',
            ));
        }
    }
    
    public function indexAction()
    {
        $this->view->layout()->setLayout('layout-index');
        $this->view->news = Model_Service::factory('news')->getAllByTopicSeoId('pressroom');
        $this->view->headTitle()->exchangeArray(array());
        $this->view->headTitle('ПРЕСС-ЦЕНТР');
        /*$this->view->news = $this->_getNewsService()->paginatorGetAllActive(
            $this->getHelper('RowsPerPage')->getValue(), 
            $this->_getParam('page')
        );*/
    }
    public function newsFullAction()
    {
        $this->view->layout()->setLayout('layout-index');
        $page = $this->getRequest()->getParam('page');
        $news = Model_Service::factory('news')->getComplexBySeoId($page);
        $news_all = Model_Service::factory('news')->getAllByTopicSeoId('pressroom');
        $this->view->page = $news;
        $this->view->news_all = $news_all;
        $this->view->headTitle('Советы консультанта');
        $next_seo_id = "";
        $next = false;
        foreach($news_all as $onenews){
            if($next) { 
                $next_seo_id = $onenews->seo_id;
                break;
            }
            if($news->id == $onenews->id)
                $next = true;
        }
        $this->view->next_seo_id = $next_seo_id;
        /*$this->view->news = $this->_getNewsService()->paginatorGetAllActive(
            $this->getHelper('RowsPerPage')->getValue(), 
            $this->_getParam('page')
        );*/
    }
    
    public function detailedAction()
    {
        $this->view->layout()->setLayout('layout-detailed');
        $news = $this->_getNewsService()->getComplexBySeoId($this->_getParam('seo_id'));
        //$service = $this->_getService();
        //$page = $service->get($this->_getParam('seo_id'));
        $this->view->headTitle($news['title']);
        $this->view->headMeta($news['meta_keywords']);
        $this->view->headMeta($news['meta_description']);
        $this->view->headdescription = $news->meta_description;
        $this->view->headkeywords = $news->meta_keywords;
        $this->view->news = $news;
        if ($service->isDriverEnabled($news->driver)) {
            $driver = $this->getHelper('PageDriver_'.$news->driver);
            if ($this->getRequest()->isXmlHttpRequest() AND $driver->isAjaxAccepted()) {
                $this->view->layout()->disableLayout();
                $this->getHelper('ViewRenderer')->setNoRender();
                $response = $driver->ajaxAction();
                echo $response;
            }
            else if ( ! $this->getRequest()->isXmlHttpRequest()) {                
                $response = $driver->action();
                $this->view->driverHtml = $response;
            }
        }
    }

    public function topicAction()
    {
        $this->_forward('topic', 'news', 'kernel', $this->_getForwardParams());
    }    
    
    public function ajaxSubscribeAction()
    {
        $this->_forward('ajax-subscribe', 'news', 'kernel', $this->_getForwardParams());
    }    
    
    public function unsubscribeAction()
    {
        $this->_forward('unsubscribe', 'news', 'kernel', $this->_getForwardParams());
    }    

    protected function _getForwardParams()
    {
        $params = $this->getRequest()->getParams();
        return $params;
    }

    public function pressroomAction()
    {
        $this->view->news = Model_Service::factory('news')->getAllByTopicSeoId('pressroom');
        $this->view->headTitle()->exchangeArray(array());
        $this->view->headTitle('ПРЕСС-ЦЕНТР');
    }

    public function ajaxPressroomFullAction()
    {
        if ($this->getRequest()->isXmlHttpRequest()) {
            $params = $this->getRequest()->getParams();
            $news = Model_Service::factory('news')->getAllByNewsSeoIdFull($params['seo_id']);
            die(Zend_Json::encode(array(
              'success' => TRUE, 
              'full' => $news->full, 
              'date' => date('d.m.Y', strtotime($news->date_publish)), 
              'title' => $news->title, 
              'title2' => $news->title2
            )));
        }
    }
    
        
